class UmPsalmsContentSeeder{

  static List<PsalmsContent> items() {
    return [
      PsalmsContent(id: 100, position: 1, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_19, content: "Ilu li sapula ulamba wa Suku. Oluali lu situlula ovilinga viovaka aye. Utanya u sapuila utanya. Uteke u longisa uteke uloño. Upopi ka ku li, ndanõ elimi. Ondaka yao ka yi yevala. Haimo esapulo liao lia pitila kolofeka viosi, olondaka viao toke kesulilo lioluali luosi."),
      PsalmsContent(id: 101, position: 2, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_19, content: "Olondaka viomela wange, lovisimilo viutima wange, vi sunguluke kokuove, a Yehova, wucikolo cange, have wunjovoli yange."),
      PsalmsContent(id: 102, position: 3, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_19, content: "Kokuavo wa nyanyumuilako ombalaka yekumbi. Olio li linga ndukuandombua o tunda vohondo yaye, li yolela ndonõi yi lupukila oku litunda. Oku tunda kualio tunde kesukiyo lilu. Oku ñuala kualio toke kasulilo alio. Ka ku li eci ci puluka kowuya walio."),
      PsalmsContent(id: 103, position: 4, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_19, content: "Olondaka viomela wange, lovisimilo viutima wange, vi sunguluke kokuove, a Yehova, wucikolo cange, have wunjovoli yange."),
      PsalmsContent(id: 104, position: 5, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_19, content: "Ovihandeleko via Yehova via sunguluka, vi kavuluisa utima. Uvangi wa Yehova wocili, u muisa olondunge, ava va wulua. Ovisila via Yehova via sunguluka, vi sanjuisa utima. Ocihandeleko ca Yehova ca pua eko, ci yelisa ovaso."),
      PsalmsContent(id: 105, position: 6, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_19, content: "Olondaka viomela wange, lovisimilo viutima wange, vi sunguluke kokuove, a Yehova, wucikolo cange, have wunjovoli yange."),
      PsalmsContent(id: 106, position: 7, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_19, content: "Usumba wa Yehova we lipua, wenda ño-o hũ. Olonimbu via Yehova viocili, viesunga muele. Ca sesamela oku vi livela ca piãla, okuti ulu u sule, ndanõ ulu wa lua wa fina, oku sõsa via piãla, okuti owiki u sule, ndanõ wowu u loka loka kocingo. Kuenda vali, ukuenje wove o lungowaiwa lavio. Oku vi linga, ku kuete onima ya lua."),
      PsalmsContent(id: 107, position: 8, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_19, content: "Olondaka viomela wange, lovisimilo viutima wange, vi sunguluke kokuove, a Yehova, wucikolo cange, haive wunjovoli yange."),
      PsalmsContent(id: 108, position: 9, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_19, content: "O tẽla oku limbuka oku lueya kuaye helie? Njelise ovina viuyombeki. Tateka ukuenje wove kakandu ocipango, ka a ka njike. Oco ndi lipua, kuenje si lueya ca piãla."),
      PsalmsContent(id: 109, position: 10, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_19, content: "Olondaka viomela wange, lovisimilo viutima wange, vi sunguluke kokuove, a Yehova, wucikolo cange, have wunjovoli yange."),

      PsalmsContent(id: 110, position: 1, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_24, content: "Ongongo ya Yehova, leci ce yukamo; oluali, lava va tungamo. Eye wa lu seveta kokalunga. Wa lu kolisa kolondui."),
      PsalmsContent(id: 111, position: 2, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_24, content: "O lamana komunda ya Yehova helie? Helie o talama kocitali caye ci kola?"),
      PsalmsContent(id: 112, position: 3, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_24, content: "U o kasi lovaka a yela lutima wa pua evĩho. U ka tiamisile utima waye kuhembi. U ka likuminyile lesanda. Eye o mõla, ku Yehova, esumuluho, lesunga ku Suku ukueyovo liaye. Eyi oyo ombuto yomanu vo sandiliya, haivo va sanda ocipala ca Suku ya Yakomba."),
      PsalmsContent(id: 113, position: 4, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_24, content: "Petuli ovitue viene, alombundi. Petuki apito onahũlu; kuenje, Soma yulamba iñilamo."),
      PsalmsContent(id: 114, position: 5, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_24, content: "Helie soma yaco yulamba?"),
      PsalmsContent(id: 115, position: 6, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_24, content: "Yehova wa kola, wa pama, Yehova wa pama kocilunga. Petuli ovitue viene, alombundi. Petuki, apito onahulu; kuenje, Soma yulamba iñilamo."),
      PsalmsContent(id: 116, position: 7, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_24, content: "Helie soma yaco yulamba?"),
      PsalmsContent(id: 117, position: 8, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_24, content: "Yehova Ukualohoka, Eye Soma yulamba."),

      PsalmsContent(id: 118, position: 1, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_33, content: "Yoleli Yehova, alondingesunga. Esivayo lia posokela ava va sunguluka. Panduli Yehova lohalupa. U tumbangiyi locisikilo, cekui liovikolo. Wimbili ocisungo cokaliye. Siki lulonõ locileñi  ca lua. Momo ondaka ya Yehova ya sunguluka. Upange waye wosi u kasi luyito. O sole esunga, locili. Oluali lue yuka ocisola ka ci pui ca Yehova."),
      PsalmsContent(id: 119, position: 2, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_33, content: "A Yehova, ocisola cove ka cipui ci kale letu, momo tua ku imba ovaso."),
      PsalmsContent(id: 120, position: 3, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_33, content: "Ilu lia lulikiwa londaka ya Yehova. Ovina viosi lofela yomela waye. Ongeka ovava okalunga ndondunda. O soleka alondo aco volosila. Oluali luosi lu sumbile Yehova. Omanu vosi va tunga kilu lieve vo yokokele, momo wa popia kuenje ca lingiwa, wa handeleka kuenje ca kola."),
      PsalmsContent(id: 121, position: 4, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_33, content: "A Yehova, ocisola cove ka ci pui ci kale letu, momo tua ku imba ovaso."),
      PsalmsContent(id: 122, position: 5, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_33, content: "Yehova imula ahãla a vakualofeka. O seluisa ovisimilo viomanu. Elungulo lia Yehova li tumãla oloneke ka vi pui, lovisimilo viutima waye tunde kocitumbulukila toke kocitumbulukila. Ofeka ya sumũlũha nda Yehova eye Suku yayo, okuti omanu vaco eye a nola va linga ocipiñalo caye."),
      PsalmsContent(id: 123, position: 6, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_33, content: "A Yehova, ocisola cove ka ci pui ci kale letu, momo tua ku imba ovaso."),
      PsalmsContent(id: 124, position: 7, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_33, content: "Yehova o kasi kilu o vanja vanja. O lete omala vosi vomanu. Oko a tumala o vanja vanja omanu vosi va tunga kilu lieve. Eye wa sovola ovitima via vosi. Ovilinga viavo viosi eye o vi kulãhaisa."),
      PsalmsContent(id: 125, position: 8, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_33, content: "A Yehova, ocisola cove ka ci pui ci kale letu, momo tua ku imba ovaso."),
      PsalmsContent(id: 126, position: 9, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_33, content: "Tali, isso lia Yehova li vanja ava vo sumbila, lava va lavoka ocisola caye ka ci pui, ha popela ovimuenyo viavo kokufa, loku va muisa omuenyo ponjala. Ovitima vietu via imba ovaso Yehova. Eye o tu ohela, haeye otevele. Ovitima vietu vi u yolela, momo tua kolela onduko yaye yi kola."),
      PsalmsContent(id: 127, position: 10, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_33, content: "A Yehova, ocisola cove ka ci pui ci kale letu momo tua ku imba ovaso."),

      PsalmsContent(id: 128, position: 1, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_34, content: "Mandula Yehova oloneke viosi. Ñala ño-o hũ lesivayo liaye vomela. Utima wange u litambelela Yehova. Olohukui vi yevako kuenje vi yolela."),
      PsalmsContent(id: 129, position: 2, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_34, content: "Va kemainye Yehova kumuamue lame. Tu pandiyili pamosi onduko yaye. Nda sanda Yehova kuenje wa nambulula, wa mopela kovinjoko viange viosi. Wimbili ovaso kuenje vu sanjuka, lalimue eteke ovipala viene vi nyumãla."),
      PsalmsContent(id: 130, position: 3, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_34, content: "Ohukui ya vilikiya, Yehova wa yi  yeva, wa yi popela kovitangi viayo viosi. Ungelo wa Yehova o ñuala ava vo sumbila, ha va popela. Seteki oco vu limbuke okuti Yehova ukuahenda. Omunu wosi o wunda kokuaye o sumũlũha. Sumbili Yehova, alosandu viaye, momo ka ku li usuke kuava vo sumbila."),
      PsalmsContent(id: 131, position: 4, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_34, content: "Omãla volohosi olonjanja va kamba eci va lia, kuenje va lambuka. Ava puãi va sanda Yehova lacimue ciwa va sukila."),
      PsalmsContent(id: 132, position: 5, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_34, content: "Amãla, enjui, njeveleli, oco ndu longisi oku sumbila Yehova. Omunu upi o yongola omuenyo, haeye o livela oloneke via lua ha moli evi viwa? Lava elimi liove kevĩho, lomela wove okuti ko popi uhembi. Keviho tundako. Linga evi viwa. Sandiliya ombembua, yi landula muẽle."),
      PsalmsContent(id: 133, position: 6, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_34, content: "Ovaso a Yehova a vanja vakuesunga, o vonguila ovatui aye kevilikiyo liavo. Ocipala ca Yehova ca temela olondingãivi, ha imula onjivaluko yavio kilu lieve."),
      PsalmsContent(id: 134, position: 7, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_34, content: "Vakuesunga va vilikiya, Yehova wa va yeva, wa va popela kovitangi viavo viosi. Yehova yu ocipepi la vakuavitima via teka. O popela ava va kasi lovitima via samba."),
      PsalmsContent(id: 135, position: 8, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_34, content: "Ohali yukuesunga ya lua, puãi Yehova u popela kohali yosi. O lava akepa aye osi, lalimue li teka."),
      PsalmsContent(id: 136, position: 9, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_34, content: "Evĩho li ponda ondingaĩvi. Ava va suvuka vakuesunga va pisiwa."),
      PsalmsContent(id: 137, position: 10, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_34, content: "Yehova o yovola ovimuenyo viakuenje vaye. Lomue o wunda kokuaye o pisiwa."),

      PsalmsContent(id: 138, position: 1, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_46, content: "Suku eye ocikolo cetu haeye ongusu yetu. Eye oñuatisi, kohali o moleha lombili. Oco ka tu yokoka ndãno oluali lu pongoloka, ndãno olomunda vi undumuhila vokati kokalunga; ndnõ ovava aco a yuela, a tumõha; ndãno olomunda vi luluma lakimba aco."),
      PsalmsContent(id: 139, position: 2, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_46, content: "Yehova Ukualohoka o kasi letu. Suku ya Yakoba eye ocikolo cetu."),
      PsalmsContent(id: 140, position: 3, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_46, content: "Kuli olui omãla valuo va sanjuisa imbo lia Suku. Olio omangu yi kola yolonembele via Tõlo. Suku yu vokati kalio, ka li sengiwa. Suku o li ohela omele ociteketeke. Olofeka via kaluka, ovoviali a lisenga. Eye wa popia, kuenje oluali lua yenguluka."),
      PsalmsContent(id: 141, position: 4, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_46, content: "Yehova Ukualohoka o kasi letu. Suku ya Yakoba eye ocikolo cetu."),
      PsalmsContent(id: 142, position: 5, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_46, content: "Enjui, ndo tali ovilinga via Yehova, alunda wa lingisa kilu lieve. Imõla ovita toke kesukiyo liongongo. O teya ohonji. O teta pokati onjelia. O yoka akãlu vondalu. Liwekipo, limbuki okuti ame Suku. Ñemãla pokati kolofeka, ñemãla kilu lieve."),
      PsalmsContent(id: 143, position: 6, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_46, content: "Yehova Ukualohoka o kasi letu. Suku ya Yakoba, eye ocikolo cetu."),

      PsalmsContent(id: 144, position: 1, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_67, content: "Suku a tu linge ohenda, a tu sumuluise, a tu tuisile ocipala caye. Oco ocituwa cove ci kulihiwe kilu lieve, leyovo liove pokati kolofeka."),
      PsalmsContent(id: 145, position: 2, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_67, content: "Omanu va ku sivaye, a Suku. Omanu vosi va ku sivaye."),
      PsalmsContent(id: 146, position: 3, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_67, content: "Olofeka vi sanjuke, vi imbaimbe lonjolela, momo o tetuluila omanu lesunga, kuenje o viala olofeka viokilu lieve."),
      PsalmsContent(id: 147, position: 4, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_67, content: "Omanu va ku sivaye, a Suku. Omanu vosi va ku sivaye."),
      PsalmsContent(id: 148, position: 5, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_67, content: "Osi ya ima ovaima ayo. Suku, eye Suku yetu, wa tu sumuluisa. Suku wa tu sumuluisa. Asukiyo osi oluali o sumbile."),
      PsalmsContent(id: 149, position: 6, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_67, content: "Omanu va ku sivaye, a Suku. Omanu vosi va ku sivaye."),

      PsalmsContent(id: 150, position: 1, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_90, content: "A Yehova, ove wucitungilo cetu tunde kovitumbulukila viosi."),
      PsalmsContent(id: 151, position: 2, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_90, content: "Eci olomunda ka via citiwile handi, osimbu kua lulikile handi ongongo loluali, tunde ka ku ci toke ka ku ci, ove muẽle Suku."),
      PsalmsContent(id: 152, position: 3, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_90, content: "O tiuwiya omunu keve. O lingainga huti, tiukili, amãla vomanu."),
      PsalmsContent(id: 153, position: 4, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_90, content: "Ocili, kovaso ove ohulukãi yalima ya soka nda hela lia pita, ndotembo va lendaela vuteke."),
      PsalmsContent(id: 154, position: 5, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_90, content: "O va kungulula ndendunde. Va soka ndotulo. Omele va soka ndowangu wa kula. Omele u talala, u yova, oñolosi u keluiwa, uvuka."),
      PsalmsContent(id: 155, position: 6, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_90, content: "Ocili, tua liwa lonyeño yove. Tua tokotelua loku tema kuove"),
      PsalmsContent(id: 156, position: 7, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_90, content: "Wa tumbika olongole vietu kovaso ove, akandu etu uyombeki kocinyi cocipala cove."),
      PsalmsContent(id: 157, position: 8, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_90, content: "Ocili, oloneke vietu viosi vi pita pita lonyenõ yove. Tu malusula anyamo etu ndoku tula omuenyo. Oloneke vietu kulo kilu lieve vi tẽla akũi epanduvali kanyamo, pamue, mekonda liongusu, akui ecelãla kanyamo. Haimo lumue upami wao upange lika, lesumuo. Momo u nyoleha ndopo kuenje tu taka."),
      PsalmsContent(id: 158, position: 9, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_90, content: "Elie wa kũlĩha ongunsu yonyenõ yove, loku tema kuove ndesumbilo lia ku sesamela?"),
      PsalmsContent(id: 159, position: 10, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_90, content: "Tu longise oku tenda ciwa oloneke vietu, okuti tu liupilako ovitima violondunge."),
      PsalmsContent(id: 160, position: 11, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_90, content: "Tiukako, a Yehova. Toke pi? Linga ohenda akuenje vove. Tu kutise omele locisola cove ka ci pui, ha tu yolela loku sanjuka, oloneke vietu viosi. Tu sanjuise ndoloneke vina wa tu suvalisa, alima ana tua tala ohali."),
      PsalmsContent(id: 161, position: 12, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_90, content: "Upange wove u molẽhe kovakuenje vove, lunene wove we yuka ulamba, u molẽhe komãla vavo."),
      PsalmsContent(id: 162, position: 13, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_90, content: "Unu wa Yehova Suku yetu, u kale letu. Tu kolisile upange wovaka etu."),
      PsalmsContent(id: 163, position: 14, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_90, content: "Ocili, kolisa upange wovaka etu."),

      PsalmsContent(id: 164, position: 1, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_96, content: "Imbili Yehova ocisungo cokaliye. Imbili Yehova, ene alofeka viosi. Imbili Yehova, panduli onduko yaye. Lombololi eyovo liaye eteke leteke."),
      PsalmsContent(id: 165, position: 2, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_96, content: "Sapuli ulamba waye kolofeka, lovikomo viaye pokati komanu vosi."),
      PsalmsContent(id: 166, position: 3, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_96, content: "Momo Yehova unene, kuenje wa posokela esivayo lia piãla. Wa posokela esumbilo lia piãla, okuti olosuku viosi ci sule."),
      PsalmsContent(id: 167, position: 4, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_96, content: "Olosuku viosi viomanu ovina vianõ, Yehova puãi wa lulika ilu. Kovaso aye kuli ulamba lunene. Vonenbele yaye muli upami lunumbu."),
      PsalmsContent(id: 168, position: 5, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_96, content: "Tukuli Yehova, ene apata omanu. Tukuili Yehova ulamba lupami. Tukuili Yehova ulamba wa posokela onduko yaye. Neni ocilumba. Iñili vovitali viaye. Fendeli Yehova luwalo u kola. Lulumili kovaso aye, alofeka viosi."),
      PsalmsContent(id: 169, position: 6, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_96, content: "Sapuili olofeka hoti, Yehova o viala. Oluali, laluovo, lua kola, ka lu sengiwa. O tetuluila olofeka lesunga."),
      PsalmsContent(id: 170, position: 7, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_96, content: "Ilu li sanjuke. Ongongo yi yolele. Okalunga kõle, lovina viosi vie yukamo. Usenge ulule, levi viosi vi kasimo. Oviti viosi viesisi vi imbile ovisungo vionjolela kovaso a Yehova, momo iya."),
      PsalmsContent(id: 171, position: 8, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_96, content: "Momo iya oku tetuluila oluali. O tetuluila olofeka lesunga, lomanu locili caye."),

      PsalmsContent(id: 172, position: 1, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_100, content: "Yoleli Yehova, alofeka viosi. Vumbi Yehova lesanju. Pitĩli kokuaye loku imba ovisungo. Limbuki Yehova, okuti eye Suku."),
      PsalmsContent(id: 173, position: 2, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_100, content: "Eye wa tu lulika kuenje tuvaye. Tumanu vaye, tulomeme o tu lisa lisa."),
      PsalmsContent(id: 174, position: 3, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_100, content: "Iñili volombundi viaye loku imba olopandu, vovitali viaye lesivayo. U panduli; sivayi onduko yaye."),
      PsalmsContent(id: 175, position: 4, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_100, content: "Momo Yehova uwa. Ocisola caye ka ci pui, cenda ño-o hũ. Ocili caye cenda ño-o kovitumbulukila viosi."),

      PsalmsContent(id: 176, position: 1, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_103, content: "Otima wange, sivaya Yehova. Viosi vi li vonulo yange vi sivaye onduko yaye yi kola."),
      PsalmsContent(id: 177, position: 2, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_103, content: "Otima wange, sivaya Yehova. Ku ka ivaleko oviali viaye viosi."),
      PsalmsContent(id: 178, position: 3, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_103, content: "Eye ecela akandu ove osi. O sakula ovoveyi ove osi. O yovola omuenyo wove konjembo. O ku walisa ekolowa liocisola ka ci pui, kuenda ohenda. O kutisa utima wove levi viwa, hũ lingi vali ukuenje ndongonga yulombo."),
      PsalmsContent(id: 179, position: 4, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_103, content: "Yehova o lingila vakuahali esunga. O va tetuluila lesunga. Wa lombolola ku Mose olonjila viaye, lovilinga viaye ku va Isareli."),
      PsalmsContent(id: 180, position: 5, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_103, content: "Yehova Ukuahenda, o kasi locali, o livala konyeño. Ocisola caye ka cipui, ca lua cimue. Ka lemaela ño-o hũ. Ka tema tema olonjanja viosi. Ka lingile letu eci ca soka lovakandu etu. Eci ca sesamela olohõle vietu hacoko a tu muisa."),
      PsalmsContent(id: 181, position: 6, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_103, content: "Ocili, ndeci kilu kua lepa loposi, haico ocisola caye ka ci pui, kuava vo sumbila. Ndeci kutundilo kupãla lutakelo, haico a kapa oku lueya kuetu ocipãla."),
      PsalmsContent(id: 182, position: 7, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_103, content: "Ndeci isia a kuetele omãla vaye ohenda, haico Yehova a kuetele ohenda ava vo sumbila. Momo wa kũliha ovatimba etu, ka ivaluka okuti tuneketela."),
      PsalmsContent(id: 183, position: 8, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_103, content: "Oku sokolola oloneke viomunu, via soka ndowangu. O teleha ndoneleho yusenge, momo ofela yi pitako kuenje ka yiko, lapa ya kala ka pa kulihiwa vali."),
      PsalmsContent(id: 184, position: 9, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_103, content: "Ocisola ka ci pui ca Yehova puãi, ci kasi tunde ka ku ci toke ka ku ci, lava vosumbila. Esunga liaye li solomohẽla komãla, loko mãla kuava va patekela ohuminyo yaye, ava va ivaluka ovisila viaye, ha va vi lingainga."),
      PsalmsContent(id: 185, position: 10, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_103, content: "Sivayi Yehova, ene alohoka viaye viosi. Wuvakuenje vaye, wakuaku linga ocipango caye. Sivayi Yehova, avina viosi a lulika, kuõha kuviali waye. Otima wange, sivaya Yehova."),

      PsalmsContent(id: 186, position: 1, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_115, content: "A Yehova, etu hetuko muẽle, puãi muisa onduko yove ulamba, mekonda liocisola cove ka ci pui, kuenda ocili cove. Nye olofeka vi vanguila viti, Suku yavo hẽ, o kasi pi? Suku yetu o kasi muẽle kilu. Cosi a panga wa ci linga."),
      PsalmsContent(id: 187, position: 2, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_115, content: "Oviteka viavo opalata lulu, ovilulikilo viovaka omanu. Vi kasi lovimela, puãi ka vi popi. Vikuete ovaso, puãi ka vi lete. Vi kasi lovatui, puãi ka vi yevite. Vikuete anyulu puãi ka vi lehũla. Vi kasi lovaka puãi ka vi kuata. Vi kuete olomãi puãi ka vi endi. Polosingo viavo ka pa tundi ondaka."),
      PsalmsContent(id: 188, position: 3, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_115, content: "Ava va vi lulika va lisoka lavio, haico vosi va vi kolela."),
      PsalmsContent(id: 189, position: 4, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_115, content: "A Isaleli, kolela Yehova."),
      PsalmsContent(id: 190, position: 5, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_115, content: "Eye oñuatisi yavo, haeye ombindikiyo yavo."),
      PsalmsContent(id: 191, position: 6, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_115, content: "Ene anjo ya Alone, koleli Yehova."),
      PsalmsContent(id: 192, position: 7, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_115, content: "Eye oñuatisi yavo, haeye ombindikiyo yavo."),
      PsalmsContent(id: 193, position: 8, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_115, content: "Ene wa sumbili Yehova, koleli Yehova."),
      PsalmsContent(id: 194, position: 9, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_115, content: "Eye oñuatisi yavo, haeye ombindikiyo yavo."),
      PsalmsContent(id: 195, position: 10, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_115, content: "Yehova wa tu ivaluka; o tu sumuluisa. O sumuluisa onjo yi Isaleli. O sumuluisa onjo ya Alone."),
      PsalmsContent(id: 196, position: 11, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_115, content: "O sumuluisa vosi va sumbila Yehova, lava vatito lava vanene."),
      PsalmsContent(id: 197, position: 12, person: PsalmsPerson.DIRECTOR, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_115, content: "Yehova o luisi luisi, ene lomãla vene. Yehova, u wa lulika ilu longongo, o sumuluisi."),
      PsalmsContent(id: 198, position: 13, person: PsalmsPerson.CONGREGATION, psalmsTitle: UmPsalmsTitleSeeder.OSAMO_115, content: "Ilu lia Yehova, ongongo puãi wa yeca komãla vomanu. Etu puãi tu pandula Yehova, tunde opo toke ka ku ci. Sivayi Yehova."),

    ];
  }
}